import {BrowserRouter,Routes ,Route} from 'react-router-dom'
import Header from "./components/header/Header.jsx";
import Home from './pages/home/Home.jsx'
import Login from './pages/forms/Login.jsx'
import Register from './pages/forms/Register.jsx'
import PostPage from './pages/post-page/Post-Page.jsx'
import AdminDashborad from './pages/admin/Admin-Dashborad.jsx'
import CreatePage from './pages/create-post/Create-post.jsx'

function App() {
  return (
    <BrowserRouter>
    <Header/>
    <Routes >
    <Route path="/" element={<Home />} />
    <Route path="/login" element={<Login />} />
    <Route path="/register" element={<Register />} />
    <Route path="/posts/:id" element={<PostPage />} />
    <Route path="/admin" element={<AdminDashborad />} />
    </Routes>
    </BrowserRouter>
  );
}

export default App;
